(1, 'Men\'s Belt', 0, 'Explore the Essence of Elegance in our Men\'s Leather Belt Collection. Crafted with Precision from the Highest-Grade Leather, these Timeless Accessories Merge Superior Craftsmanship with a Variety of Styles and Colors, Elevating Your Wardrobe to a New Level of Refinement and Versatility.', '', '240715082920lp mens belts.jpg', 1),
(2, 'Men\'s Wallet', 0, 'Discover Unmatched Quality and Style in our Men\'s Leather Wallets Collection. Meticulously Handcrafted from Premium Leather, Our Wallets Combine Sleek Designs with Functionality. Explore a Variety of Styles and Colors, and Elevate Your Essentials with Timeless Accessories.', '', '240715083253lp menswallets.jpg', 2),
(3, 'Women\'s Belt', 0, 'Crafted with meticulous attention to detail, our belts seamlessly blend style and function. From classic designs to trendy statement pieces, we offer a wide range of styles and colors to complement every outfit. Discover the perfect accessory to define your unique style.', '', '240715110457lp womens belt (1) (1).jpg', 3),
(4, 'Suspenders', 0, 'Elevate Your Look with Our Men\'s Suspenders Collection. Explore a range of styles and colors designed to add a touch of sophistication to your attire. Crafted with precision and featuring nickel-free buckles, our suspenders offer both style and comfort, making them the perfect accessory for any occasion.', '', '240715083443lp suspenders.jpg', 4),
